import { useDispatch } from "react-redux";
import { galleryActions } from "../../store/images-slice";
import classes from "./Imagelarger.module.css";

function ImageLarger({
  id,
  url,
  description,
  name,
  isChecked,
  showSelectButton,
  onClick,
  className
})
 {
 
  return (
    <>
      <img
        onClick={(a) => onClick && onClick(a)}
        src={url}
        className={classes.img}
        alt={description}
      ></img>
      {showSelectButton && (
        <input
          type="checkbox"
          className={classes.checkbox}
          onChange={imageCheckedHandler}
          checked={isChecked}
        ></input>
      )}
      <p className={classes.caption}>{name}</p>
    </>
  );
}

export default  ImageLarger;
